class Header extends React.Component {
    constructor () {
        super();
    }

    return(){
        render (
            <div>
                <h1>Captivating Currency Converter</h1>
                <a href="#ctable">Currency Table</a>
                <a href="#cconverter">Currency Converter</a>
            </div>
        )
    }
}

export default Header;
